import React from "react";

function CommunityList_List({ communitylist }) {
  return (
    <div>
      {communitylist.map((it) => (
        <div key={it.id}>{it.community_name}</div>
      ))}
    </div>
  );

  CommunityList_List.defaultProps = {
    communitylist: [],
  };
}

export default CommunityList_List;
